import React, { useEffect, useState } from 'react';

const Result = ({ user_cpu, user_gpu, user_ram, game_name }) => {
    const [results, setResults] = useState([{
      'min_cpu': 'null',
      'min_gpu': 'null',
      'min_ram': 'null',
      'rec_cpu': 'null',
      'rec_gpu': 'null',
      'rec_ram': 'null'
    }])

    const fetchResults = async () => {
      try {
        const response = await fetch(`http://localhost:3001/api/verify?id=${game_id}`);
        const data = await response.json();
        setResults(data);
      } catch (error) {
        console.log(error);
        const dummy = [{
          'min_cpu': 'None',
          'min_gpu': 'None',
          'min_ram': 'None',
          'rec_cpu': 'None',
          'rec_gpu': 'None',
          'rec_ram': 'None'
        }];
        setResults(dummy);
      }
    };

    useEffect(() => {
      fetchResults();
    }, [game_id]);

  return (
    <div>
      <div className='result'>
          'min_cpu': {results[0].min_cpu}
          <br/>
          'min_gpu': {results[0].min_gpu}
          <br/>
          'min_ram': {results[0].min_ram}
          <br/>
          'rec_cpu': {results[0].rec_cpu}
          <br/>
          'rec_gpu': {results[0].rec_gpu}
          <br/>
          'rec_ram': {results[0].rec_ram}
      </div>
    </div>
  );
};

export default Result;
